INSERT INTO `notiziario` (`id`, `team`, `data`, `notizia`) VALUES
(1, 'jammins', '2010-11-17', 'Benvenuto sexjam. Ora sei il nuovo manager della squadra jammins.<br>Ricordati che la Dirigenza ha puntato tutto su di te per portare la squadra nella massima serie.<br>Ti è stato affidato un budget di €. 250.000 da far fruttare e 18 giocatori che dovrai allenare al meglio delle tue possibilità.<br>Ora è tutto nelle tue mani. In bocca al lupo.'),
(2, 'prova', '2010-11-17', 'Benvenuto prova. Ora sei il nuovo manager della squadra prova.<br>Ricordati che la Dirigenza ha puntato tutto su di te per portare la squadra nella massima serie.<br>Ti è stato affidato un budget di €. 250.000 da far fruttare e 18 giocatori che dovrai allenare al meglio delle tue possibilità.<br>Ora è tutto nelle tue mani. In bocca al lupo.'),
