INSERT INTO `z_frasi` (`id`, `tipo`, `descri`) VALUES
(1, 10, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra %casa% e %avversario%. Abbiamo appena ricevuto le formazioni: l''allenatore del %casa% ha deciso di schierare la sua squadra con un %c_tattica%, %avversario% scende in campo con il %f_tattica%.'),
(1, 20, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a %casa% battere il calcio d''inizio.'),
(2, 20, 'Il capitano della squadra %casa% vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi %avversario% a battere il calcio d''inizio.'),
(2, 30, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e %avversario% batte il calcio d''inizio del primo tempo.'),
(1, 30, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e %casa% batte il calcio d''inizio del primo tempo.'),
(1, 40, 'Pallone conquistato in area di rigore da %c_gio1%<br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, '),
(2, 40, '%c_gio1%  avanza con la palla a centrocampo.<br>%c_gio1%  prova lo scambio con %c_gio2%.<br>%c_gio2% riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata'),
(1, 43, '%f_gio1% interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso %f_gio1% e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per %casa%<br>il braccio alzato dell''arbitro indica che è di seconda<br>%c_gio1% tocca il pallone per il compagno<br>%c_gio2% prova a piazzare il pallone sul palo coperto dalla barriera'),
(1, 50, '<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(2, 50, '<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(3, 50, '<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(1, 145, 'L''arbitro fischia la fine del primo tempo e manda tutti a prendere qualcosa da bere.'),
(1, 190, 'Non c''è più tempo, l''arbitro fischia la fine della partita.'),
(3, 40, 'Preciso lancio lungo a pescare in area avversaria %c_gio1%.<br>%c_gio1% passa a %c_gio2%<br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata'),
(4, 50, '<br>è incredibile cosa sia riuscito a sbagliare!'),
(2, 43, '%f_gio1% interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br>%c_gio1% tocca il pallone per il compagno<br>%c_gio2% calcia d''interno cercando di piazzare il pallone all''incrocio'),
(5, 50, '<br>ma svirgola il pallone e l''azione sfuma.'),
(1, 41, 'Bel passaggio per %c_gio1% sulla fascia sinistra<br>%c_gio1% stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro'),
(1, 46, 'I difensori di %avversario% scattano in avanti cercando di mettere in fuorigioco gli avversari'),
(4, 40, '%c_gio1%  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su %f_gio1% e cambia traiettoria'),
(1, 100, '<br>e %f_por% viene preso in contropiede senza che riesca a reagire in tempo!<br> GOAL per %casa%.'),
(7, 50, '<br>ma la porta di %f_por% non corre nessun pericolo.'),
(2, 45, '%c_gio1% avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(8, 55, '<br>ma viene immediatamente pressato e perde il pallone'),
(2, 41, '%c_gio1% raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa '),
(2, 101, '<br>il traversone è per %c_gio2% che salta altissimo e colpisce di testa indirizzando il pallone verso l''incrocio dei pali. Straordinario GOAL!!!'),
(5, 40, 'Preciso lancio lungo a pescare in area avversaria %c_gio1%.<br>punta %f_gio1%<br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro'),
(3, 100, '<br>%f_por% rimane immobile e non può far altro che seguire il pallone con lo sguardo.<br>GOAL per %casa%!'),
(6, 40, '%c_gio1% si guadagna la palla a centrocampo<br>non trova nessun compagno libero e prova ad avanzare da solo<br>con un bellissimo gioco di gambe supera due avversari<br>si apre un varco e passa la palla a %c_gio2% che è libero<br>il gioco é in mano, o meglio nei piedi di %c_gio2%<br>ha il tempo di mirare e prova il tiro'),
(4, 100, '<br>%f_por% si allunga il più possibile, ma riesce solo a sfiorare il pallone.<br>GOAL per %casa%.'),
(9, 55, '<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(3, 45, 'Bell''iniziativa di %c_gio1% sulla fascia sinistra<br>ha %f_gio1% davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo'),
(5, 100, '<br>e segna con un tiro ben piazzato! GOAL per  %casa%.'),
(4, 45, '%c_gio1% stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per %c_gio2%<br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone'),
(10, 50, '<br>ma svirgola malamente e manca la porta!'),
(3, 43, 'Intervento piuttosto ruvido di %f_gio1% ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per %casa% in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di %c_gio1%<br>dà un ultimo sguardo al portiere e tira'),
(11, 50, '<br>ma il pallone finisce ampiamente sopra la traversa.'),
(2, 145, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
(2, 146, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(1, 146, 'Il secondo tempo comincia con gli ospiti in possesso di palla.'),
(1, 42, 'Calcio d''angolo per  %casa%<br>%c_gio1% è pronto a battere<br>palla lunga sul secondo palo<br>%c_gio2% e %f_gio1% si lanciano insieme sul pallone<br>%c_gio2% aiutandosi con le braccia riesce a tenere a distanza l''avversario'),
(12, 50, '<br>ma %f_por% con un riflesso incredibile riesce a respingere il pallone.'),
(13, 50, '<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
(15, 50, '<br>ma il pallone si perde sul fondo!'),
(14, 50, '<br>ma il tiro è troppo debole per impensierire %f_por%.'),
(1, 56, '<br>e la trappola è scattata! Fuorigioco netto!'),
(9, 55, '<br>ma è pressato da %f_gio1% e perde il controllo del pallone.'),
(2, 42, 'Calcio d''angolo per  %casa%<br>si incarica della battuta %c_gio1%<br>pallone calciato con molto effetto in mezzo all''area<br>%c_gio2% stoppa la palla con il petto'),
(5, 45, 'Pallone conquistato in area di rigore da %c_gio1%<br>passaggio di %c_gio1% verso %c_gio2%<br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare'),
(6, 100, '<br>e con un tiro potentissimo quasi sfonda la rete! GOAL per %casa%!!!'),
(7, 100, '<br>palo interno e gol! GOAL per %casa%.'),
(8, 100, '<br>e %c_gio3% con una sforbiciata mette il pallone all''incrocio! GOAL per %casa%.'),
(3, 51, '<br>ma %f_gio1% si immola in scivolata e respinge il pallone.'),
(2, 10, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra %casa% e %avversario%. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: %casa% si schiera in campo con un %c_tattica%, l''allenatore del %avversario% ha optato per il %f_tattica%.'),
(3, 42, 'Calcio d''angolo per %casa%<br>se ne incarica %c_gio1%<br>cross morbido al centro dell''area di rigore<br>%c_gio2% e %f_gio1% cercano entrambi di arrivare sul pallone<br>%c_gio2% riesce abilmente ad anticipare l''avversario'),
(7, 40, 'Bell''iniziativa di %c_gio1% fascia sinistra<br>%c_gio1% arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di %c_gio2% e prova subito il tiro'),
(1, 45, 'Azione pericolosa di %c_gio1% sulla fascia sinistra <br>punta %f_gio1% e lo supera senza problemi<br>dribbla un paio di avversari con un doppio passo<br>cerca di trovare lo spazio giusto per tirare'),
(8, 40, '%c_gio1% riceve palla sulla sua fascia di competenza<br>corre lungo la fascia laterale<br>effettua un passaggio a %c_gio2%<br>con uno stop perfetto si è portato in ottima posizione<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata'),
(9, 40, 'Pallone stoppato magistralmente in area di rigore da %c_gio1%<br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro'),
(6, 50, '<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(16, 50, '<br>ma %f_gio2% si immola in scivolata e respinge il pallone.'),
(10, 40, '%c_gio1% conquista il pallone a centrocampo<br>triangolo con %c_gio2% che con un colpo di tacco smarcante restituisce palla a %c_gio1% in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso'),
(2, 100, '<br>ed il tiro finisce nell''angolino basso. GOAL per %casa%!'),
(3, 41, 'Bell''iniziativa di %c_gio1% sulla fascia sinistra<br>%c_gio1% arriva sul fondo e crossa al centro'),
(4, 41, 'Bell''iniziativa di %c_gio1% sulla fascia destra<br>prova a crossare'),
(5, 41, '%c_gio1% lotta per conquistare il pallone sul vertice destro del limite dell''area di rigore<br>dribbla un avversario, poi un altro e crossa in area'),
(6, 41, '%c_gio1% raccoglie una palla vagante sulla fascia sinistra<br>prova a crossare'),
(7, 41, 'Azione pericolosa di %c_gio1% sulla fascia sinistra<br>cross insidioso di %c_gio1% '),
(4, 42, 'Calcio d''angolo per %casa%<br>%c_gio1% corre verso la bandierina e si appresta a battere<br>la palla arriva molto forte in area di rigore<br>%c_gio2% e %f_gio1% si lanciano insieme sul pallone'),
(5, 42, 'Calcio d''angolo per %casa%<br>se ne incarica %c_gio1%<br>la palla arriva molto forte in area di rigore'),
(6, 42, 'Calcio d''angolo per %casa%<br>%c_gio1% è pronto a battere<br>pallone calciato d''interno con molto effetto<br>la palla arriva all''altezza del dischetto<br>%c_gio2% e %f_gio1% saltano spalla a spalla per colpire il pallone'),
(7, 42, 'Calcio d''angolo per %casa%<br>%c_gio1% è pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, %c_gio2% e %f_gio1% saltano insieme'),
(8, 42, 'Calcio d''angolo per %casa%<br>%c_gio1% corre verso la bandierina e si appresta a battere<br>cross morbido al centro dell''area di rigore'),
(1, 44, 'Rigore per %casa%<br>%c_gio1% si avvia verso il dischetto senza esitazioni<br>sistema con cura la palla, aspetta il fischio dell''arbitro e dopo una breve rincorsa calcia di collo pieno'),
(2, 44, 'Rigore per %casa%<br>%c_gio1% da un bacio al pallone, lo sistema a terra e prende una breve rincorsa<br>dà un ultimo sguardo al portiere e tira'),
(1, 51, '<br>ma svirgola il pallone e l''azione sfuma.'),
(2, 51, '<br>ma %f_gio1% libera con un colpo di testa.'),
(8, 50, '<br>ma %f_por% ci arriva con la punta delle dita e devia il pallone.'),
(9, 50, '<br>ma %f_por% respinge con i pugni.'),
(4, 51, '<br>ma la porta di %f_por% non corre nessun pericolo.'),
(5, 51, '<br>%c_gio2% e %f_gio1% cercano entrambi di arrivare sul pallone<br>%c_gio2% riesce abilmente ad anticipare l''avversario<br>ma non riesce a deviare in rete!'),
(6, 51, '<br>%c_gio2% e %f_gio1% cercano entrambi di arrivare sul pallone<br>%f_gio1% riesce ad anticipare l''avversario e spazza l''area di rigore.'),
(7, 51, '<br>il pallone arriva nella zona di %c_gio2%<br>ma è pressato e l''azione ricomincia con un passaggio all''indietro.'),
(8, 51, '<br>il pallone arriva nella zona di %c_gio2%<br>tenta il tiro nonostante il pressing di %f_gio1%<br>ma %f_por% para senza alcuna difficoltà!'),
(9, 51, '<br>ma giusto tra le braccia di %f_por%.'),
(10, 51, '<br>dal limite dell''area arriva in corsa %c_gio2%<br>che batte in rete a colpo sicuro<br>ma %f_por% si getta in tuffo e salva sulla linea!'),
(1, 101, '<br>%c_gio2% conquista con caparbietà il pallone<br>e passa a %c_gio3%<br>che con una sforbiciata mette il pallone all''incrocio! GOAL per %casa%!');
