(0, '2010-11-11', 8, 11, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Alfred Allman<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>ma è pressato da <font color=''#0099FF''><b>Polat Hamdiakan<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(0, '2010-11-11', 6, 8, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Anton Schaudinn<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(0, '2010-11-11', 7, 9, 'Bel passaggio per <font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma la porta di <font color=''#FF0000''><b>Silvain Gerst<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 13, 55, 'Calcio d''angolo per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> è pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, <font color=''#FF0000''><b>Gioiele Cosmi<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>celiscan<font color=''#FFFFFF''></b> saltano insieme'),
(0, '2010-11-11', 14, 58, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 5, 4, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Wawel Fgarita<font color=''#FFFFFF''></b> passa a <font color=''#FF0000''><b>Cédric Geurts<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
(0, '2010-11-11', 4, 0, '<font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>e segna con un tiro ben piazzato! GOAL per  <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> batte il calcio d''inizio del primo tempo.'),
(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> a battere il calcio d''inizio.'),
(0, '2010-11-11', 0, 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> si schiera in campo con un <b>4 3 3</b>, l''allenatore del <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b> ha optato per il <b>3 5 2</b>.'),
(0, '2010-11-11', 11, 45, 'L''arbitro fischia la fine del primo tempo e manda tutti a prendere qualcosa da bere.'),
(0, '2010-11-11', 12, 46, 'Il secondo tempo comincia con gli ospiti in possesso di palla.'),
(0, '2010-11-11', 10, 42, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(0, '2010-11-11', 9, 41, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Agostino Privitera<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Agostino Privitera<font color=''#FFFFFF''></b> passa a <font color=''#FF0000''><b>Gioiele Cosmi<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
(0, '2010-11-11', 24, 90, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>A.C STABIA</b><font color=''#FFFFFF''> è stata: 61.1%, mentre quella della squadra <font color=''#FF0000''><b>Galatticos</b><font color=''#FFFFFF''> è stata: 38.9%.'),
(0, '2010-11-11', 8, 41, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
