(0, '2010-11-11', 22, 87, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Milosz Szurek<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Rafael Angel<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(0, '2010-11-11', 20, 83, '<font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia destra<br>alza la testa, uno sguardo ai compagni e crossa <br>ma la porta di <font color=''#FF0000''><b>Ozay Ozmutlu<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 21, 84, 'Bell''iniziativa di <font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> conquista con caparbietà il pallone<br>e passa a <font color=''#FF0000''><b>Franco Wiedmann<font color=''#FFFFFF''></b><br>che con una sforbiciata mette il pallone all''incrocio! GOAL per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b>!'),
