(0, '2010-11-11', 1, 0, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> battere il calcio d''inizio.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(0, '2010-11-11', 4, 1, 'Calcio d''angolo per <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#FF0000''><b>Erik Rubio<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Napieralski<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#FF0000''><b>Mimmo Aversa<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario'),
