(0, '2010-11-11', 18, 77, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 19, 80, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
