(0, '2010-11-11', 1, 69, 'Bell''iniziativa di <font color=''#FF0000''><b>Napieralski<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Milosz Szurek<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo'),
(0, '2010-11-11', 0, 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>Galatticos</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>A.C STABIA</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>4 3 3</b>, <font color=''#FF0000''><b>Galatticos</b></font><font color=''#FFFFFF''> scende in campo con il <b>5 3 2</b>.'),
(0, '2010-11-11', 17, 75, 'Calcio d''angolo per  <font color=''#0099FF''><b>A.C STABIA<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Farre<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Cordon<font color=''#FFFFFF''></b> stoppa la palla con il petto'),
(0, '2010-11-11', 16, 74, '<font color=''#FF0000''><b>Aledreasder Fabrychiekiz<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#0099FF''><b>celiscan<font color=''#FFFFFF''></b> e cambia traiettoria<br>ma il pallone finisce ampiamente sopra la traversa.'),
