(0, '2010-11-11', 36, 91, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>Mc Piece</b><font color=''#FFFFFF''> è stata: 41.5%, mentre quella della squadra <font color=''#FF0000''><b>Silica</b><font color=''#FFFFFF''> è stata: 58.5%.'),
