(0, '2010-11-11', 33, 74, 'Intervento piuttosto ruvido di <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
