(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>porchetts</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>Gli Illuminati</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(0, '2010-11-11', 0, 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>porchetts</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>Gli Illuminati</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>porchetts</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>3 5 2</b>, <font color=''#FF0000''><b>Gli Illuminati</b></font><font color=''#FFFFFF''> scende in campo con il <b>4 3 3</b>.'),
