(0, '2010-11-11', 12, 39, 'Preciso lancio lungo a pescare in area avversaria <font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b>.<br><font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b> passa a <font color=''#0099FF''><b>Abelino Pentone<font color=''#FFFFFF''></b><br>che mette giù il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma <font color=''#FF0000''><b>Af?ar Yedek<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
