(0, '2010-11-11', 8, 12, 'Calcio d''angolo per  <font color=''#FF0000''><b>lando united<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Semming Robertsson<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>Theo Nguyen<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>kazimierz kubloszek<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>Theo Nguyen<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>ma <font color=''#0099FF''><b>sergio suarez<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
