(0, '2010-11-11', 6, 15, '<font color=''#0099FF''><b>Cristobal Sartis<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>ma il pallone scheggia la traversa e si perde sul fondo!'),
