(0, '2010-11-11', 0, 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>3 5 2</b>, l''allenatore del <font color=''#FF0000''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''> ha optato per il <b>3 5 2</b>.'),
(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>F.C.DarkNight</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(0, '2010-11-11', 24, 74, '<font color=''#0099FF''><b>Averardo Amati<font color=''#FFFFFF''></b> interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Rodrega<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b> calcia d''interno cercando di piazzare il pallone all''incrocio'),
(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>iDiavolidellaNotte</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>11 pagliacci</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#0099FF''><b>prezzatese</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
