(0, '2010-11-11', 32, 78, 'Bell''iniziativa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#FF0000''><b><font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma il pallone finisce ampiamente sopra la traversa.'),
(0, '2010-11-11', 33, 79, 'Calcio d''angolo per  <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> è pronto a battere<br>palla lunga sul secondo palo<br><font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b><font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>ma <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 31, 76, 'Pallone conquistato in area di rigore da <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b><br>passaggio di <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> verso <font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora è in ottima posizione<br>cerca di trovare lo spazio giusto per tirare<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
(0, '2010-11-11', 30, 73, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b>.<br>punta <font color=''#0099FF''><b>Nikodem GLAZAR<font color=''#FFFFFF''></b><br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro<br>e segna con un tiro ben piazzato! GOAL per  <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 29, 73, '<font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b>.<br><font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(0, '2010-11-11', 28, 73, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(0, '2010-11-11', 27, 72, 'Calcio d''angolo per  <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#FF0000''><b><font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#FF0000''><b>Galiazzo<font color=''#FFFFFF''></b> stoppa la palla con il petto<br><font color=''#0099FF''><b>Ruben MESANZA<font color=''#FFFFFF''></b> si allunga il più possibile, ma riesce solo a sfiorare il pallone.<br>GOAL per <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 26, 69, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>e <font color=''#0099FF''><b>Ruben MESANZA<font color=''#FFFFFF''></b> viene preso in contropiede senza che riesca a reagire in tempo!<br> GOAL per <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 25, 69, 'Calcio d''angolo per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b><font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario<br>ma viene immediatamente pressato e perde il pallone'),
(0, '2010-11-11', 24, 56, '<font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#0099FF''><b>Akinalp TOKAT<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(0, '2010-11-11', 20, 44, '<font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e cambia traiettoria<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
(0, '2010-11-11', 21, 45, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
(0, '2010-11-11', 22, 46, 'Il secondo tempo comincia con gli ospiti in possesso di palla.'),
(0, '2010-11-11', 23, 47, 'Azione pericolosa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> sulla fascia sinistra <br>punta <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e lo supera senza problemi<br>dribbla un paio di avversari con un doppio passo<br>cerca di trovare lo spazio giusto per tirare<br>prova a calciare, ma svirgola malamente e manca la porta!'),
(0, '2010-11-11', 18, 43, '<font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> riceve palla sulla sua fascia di competenza<br>corre lungo la fascia laterale<br>effettua un passaggio a <font color=''#FF0000''><b>Farre<font color=''#FFFFFF''></b><br>con uno stop perfetto si è portato in ottima posizione<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma il pallone si perde sul fondo!'),
(0, '2010-11-11', 19, 44, '<font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(0, '2010-11-11', 16, 41, 'Bell''iniziativa di <font color=''#FF0000''><b><font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Fritz HILMANN<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma il pallone finisce ampiamente sopra la traversa.'),
(0, '2010-11-11', 17, 43, 'Bell''iniziativa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> e prova subito il tiro<br>i difensori di <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 15, 34, '<font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>è pressato, però riesce a mantenere il controllo del pallone<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(0, '2010-11-11', 14, 34, 'Calcio d''angolo per  <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>ma il pallone finisce ampiamente sopra la traversa.'),
(0, '2010-11-11', 13, 34, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il pallone si perde sul fondo!'),
(0, '2010-11-11', 12, 32, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>ma <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 11, 32, '<font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>è incredibile cosa sia riuscito a sbagliare!'),
(0, '2010-11-11', 10, 30, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b><font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Galiazzo<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Galiazzo<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br><font color=''#0099FF''><b>Ruben MESANZA<font color=''#FFFFFF''></b> si allunga il più possibile, ma riesce solo a sfiorare il pallone.<br>GOAL per <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 8, 19, 'Bell''iniziativa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#FF0000''><b><font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma la porta di <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 9, 25, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b><font color=''#FFFFFF''></b><br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, <br>ma è pressato da <font color=''#0099FF''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(0, '2010-11-11', 6, 7, '<font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e cambia traiettoria<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(0, '2010-11-11', 7, 15, 'Bel passaggio per <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 5, 7, '<font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>i difensori di <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!');
INSERT INTO `z_telecronaca` (`id_partita`, `data`, `prog`, `min`, `descri`) VALUES
(0, '2010-11-11', 4, 6, '<font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b> batte il calcio d''inizio del primo tempo.'),
(0, '2010-11-11', 1, 0, 'Il capitano avversario ha vinto il sorteggio ed ha scelto la porta da difendere, spetterà quindi a <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b> battere il calcio d''inizio.'),
(0, '2010-11-11', 0, 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b> ha deciso di schierare la sua squadra con un <b>4 3 3</b>, <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b> scende in campo con il <b>3 5 2</b>.'),
(0, '2010-11-11', 0, 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>iDiavolidellaNotte</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>11 pagliacci</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>iDiavolidellaNotte</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>4 3 3</b>, l''allenatore del <font color=''#FF0000''><b>11 pagliacci</b></font><font color=''#FFFFFF''> ha optato per il <b>3 4 3</b>.'),
(0, '2010-11-11', 29, 88, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
