(0, '2010-11-11', 4, 0, '<font color=''#FF0000''><b>Ilario Rainaldi<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Ilario Rainaldi<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>mont real<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#0099FF''><b>Frasco Checa<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Gurur Buharali<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma <font color=''#FF0000''><b>Kivanc Bahadir<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>mont real</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>El Milo FC</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
(0, '2010-11-11', 0, 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>mont real</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>El Milo FC</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>mont real</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>3 4 3</b>, l''allenatore del <font color=''#FF0000''><b>El Milo FC</b></font><font color=''#FFFFFF''> ha optato per il <b>4 3 3</b>.'),
(0, '2010-11-11', 4, 10, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Rodrega<font color=''#FFFFFF''></b>.<br>punta <font color=''#0099FF''><b>Averardo Amati<font color=''#FFFFFF''></b><br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro<br>ma <font color=''#0099FF''><b>Claudio Lonfat<font color=''#FFFFFF''></b> respinge con i pugni.'),
(0, '2010-11-11', 5, 10, 'Azione pericolosa di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> sulla fascia sinistra<br>cross insidioso di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> <br>ma la porta di <font color=''#0099FF''><b>Claudio Lonfat<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 32, 90, 'Non c''è più tempo, l''arbitro fischia la fine della partita.<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>real cellina</b><font color=''#FFFFFF''> è stata: 19.2%, mentre quella della squadra <font color=''#FF0000''><b>mont real</b><font color=''#FFFFFF''> è stata: 80.8%.'),
(0, '2010-11-11', 31, 86, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Tansel  Süzer<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(0, '2010-11-11', 29, 79, '<font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa è ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(0, '2010-11-11', 30, 82, '<font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> raccoglie una palla vagante sulla fascia sinistra<br>prova a crossare<br>dal limite dell''area arriva in corsa <font color=''#FF0000''><b>Fuat Kizilirmak<font color=''#FFFFFF''></b><br>che batte in rete a colpo sicuro<br>ma <font color=''#0099FF''><b>Archibaldo Piedra<font color=''#FFFFFF''></b> si getta in tuffo e salva sulla linea!'),
(0, '2010-11-11', 27, 73, 'Bell''iniziativa di <font color=''#0099FF''><b>?efik Altiokka<font color=''#FFFFFF''></b> sulla fascia destra<br>prova a crossare<br><font color=''#0099FF''><b>Erazm Kulgawczuk<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#0099FF''><b>Erazm Kulgawczuk<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario<br>ma non riesce a deviare in rete!'),
(0, '2010-11-11', 28, 78, '<font color=''#FF0000''><b>Facino Natale<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#FF0000''><b>Tolunay Katalon<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#FF0000''><b>Facino Natale<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>ma <font color=''#0099FF''><b>Archibaldo Piedra<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 26, 65, 'Azione pericolosa di <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> sulla fascia sinistra<br>cross insidioso di <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> <br>ma <font color=''#0099FF''><b>Tansel  Süzer<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(0, '2010-11-11', 24, 61, '<font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> lotta per conquistare il pallone sul vertice destro del limite dell''area di rigore<br>dribbla un avversario, poi un altro e crossa in area<br>ma <font color=''#0099FF''><b>Tansel  Süzer<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(0, '2010-11-11', 25, 62, 'Bell''iniziativa di <font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>ma la porta di <font color=''#0099FF''><b>Archibaldo Piedra<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 23, 61, '<font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> lotta per conquistare il pallone sul vertice destro del limite dell''area di rigore<br>dribbla un avversario, poi un altro e crossa in area<br>il pallone arriva nella zona di <font color=''#FF0000''><b>Tümer  Yurdacan<font color=''#FFFFFF''></b><br>ma è pressato e l''azione ricomincia con un passaggio all''indietro.'),
(0, '2010-11-11', 22, 55, 'I difensori di <font color=''#0099FF''><b>real cellina<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 20, 49, 'Pallone stoppato magistralmente in area di rigore da <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b><br>si è guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>ma svirgola il pallone e l''azione sfuma.'),
(0, '2010-11-11', 21, 53, 'Bell''iniziativa di <font color=''#0099FF''><b>Ksawery Hagaj<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo'),
(0, '2010-11-11', 18, 45, 'L''arbitro fischia la fine del primo tempo e manda tutti a prendere qualcosa da bere.'),
(0, '2010-11-11', 19, 46, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(0, '2010-11-11', 17, 44, 'Calcio d''angolo per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> è pronto a battere<br>pallone calciato d''interno con molto effetto<br>la palla arriva all''altezza del dischetto<br><font color=''#FF0000''><b>Fuat Kizilirmak<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> saltano spalla a spalla per colpire il pallone'),
(0, '2010-11-11', 16, 44, 'I difensori di <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari'),
(0, '2010-11-11', 15, 44, '<font color=''#FF0000''><b>Facino Natale<font color=''#FFFFFF''></b>  si guadagna la palla a centrocampo<br>un breve sguardo alla porta e prova la botta<br>il pallone carambola su <font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> e cambia traiettoria<br>ma il portiere è in posizione perfetta e non lascia passare la sfera.'),
(0, '2010-11-11', 14, 44, 'Preciso lancio lungo a pescare in area avversaria <font color=''#FF0000''><b>Facino Natale<font color=''#FFFFFF''></b>.<br>punta <font color=''#0099FF''><b>Rudolf Henry<font color=''#FFFFFF''></b><br>questa è veramente un''ottima occasione<br>ha un po'' di spazio e prova subito il tiro<br>ma svirgola il pallone e l''azione sfuma.'),
(0, '2010-11-11', 13, 44, '<font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> interviene sull''avversario in modo scomposto e l''arbitro fischia il fallo!<br>Calcio di punizione defilato ma molto pericoloso, è come un corner corto<br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Fuat Kizilirmak<font color=''#FFFFFF''></b> calcia d''interno cercando di piazzare il pallone all''incrocio'),
(0, '2010-11-11', 11, 38, 'I difensori di <font color=''#0099FF''><b>real cellina<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 12, 42, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione è di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Facino Natale<font color=''#FFFFFF''></b><br>dà un ultimo sguardo al portiere e tira'),
(0, '2010-11-11', 10, 25, 'I difensori di <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola è scattata! Fuorigioco netto!'),
(0, '2010-11-11', 8, 17, 'Calcio d''angolo per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Placyd Serwis<font color=''#FFFFFF''></b> corre verso la bandierina e si appresta a battere<br>la palla arriva molto forte in area di rigore<br><font color=''#FF0000''><b>Tolunay Katalon<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> si lanciano insieme sul pallone'),
(0, '2010-11-11', 9, 18, '<font color=''#0099FF''><b>Tansel  Süzer<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#0099FF''><b>Tansel  Süzer<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che è di seconda<br><font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Fuat Kizilirmak<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera'),
(0, '2010-11-11', 7, 15, 'Calcio d''angolo per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b><br>se ne incarica <font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b><br>cross morbido al centro dell''area di rigore<br><font color=''#FF0000''><b>Tolunay Katalon<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Gündüz Demiriz<font color=''#FFFFFF''></b> cercano entrambi di arrivare sul pallone<br><font color=''#FF0000''><b>Tolunay Katalon<font color=''#FFFFFF''></b> riesce abilmente ad anticipare l''avversario'),
(0, '2010-11-11', 5, 5, 'Calcio d''angolo per <font color=''#FF0000''><b>mont real<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Ilker Keser<font color=''#FFFFFF''></b> corre verso la bandierina e si appresta a battere<br>cross morbido al centro dell''area di rigore'),
(0, '2010-11-11', 6, 5, 'Azione pericolosa di <font color=''#0099FF''><b>Eliasz Gasiul<font color=''#FFFFFF''></b> sulla fascia sinistra<br>cross insidioso di <font color=''#0099FF''><b>Eliasz Gasiul<font color=''#FFFFFF''></b> <br>ma la porta di <font color=''#FF0000''><b>Leonard Henzi<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>mont real</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
