(0, '2010-11-11', 0, 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>real cellina</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>mont real</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>real cellina</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>3 4 3</b>, <font color=''#FF0000''><b>mont real</b></font><font color=''#FFFFFF''> scende in campo con il <b>3 4 3</b>.'),
(0, '2010-11-11', 2, 0, 'L''arbitro dopo un rapido cenno d''intesa con i capitani fischia e <font color=''#FF0000''><b>porchetts</b></font><font color=''#FFFFFF''> batte il calcio d''inizio del primo tempo.'),
(0, '2010-11-11', 0, 0, 'A tutti voi un sincero saluto ed un caloroso benvenuto. Stiamo per assistere oggi all''atteso incontro tra <font color=''#0099FF''><b>Gli Illuminati</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>porchetts</b></font><font color=''#FFFFFF''>. Poco prima della partita gli allenatori delle rispettive squadre hanno reso note le formazioni: <font color=''#0099FF''><b>Gli Illuminati</b></font><font color=''#FFFFFF''> si schiera in campo con un <b>4 3 3</b>, l''allenatore del <font color=''#FF0000''><b>porchetts</b></font><font color=''#FFFFFF''> ha optato per il <b>3 5 2</b>.'),
(0, '2010-11-11', 17, 63, 'I difensori di <font color=''#FF0000''><b>Galatticos<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari'),
(0, '2010-11-11', 1, 0, 'Il capitano della squadra <font color=''#0099FF''><b>Gli Illuminati</b></font><font color=''#FFFFFF''> vince il sorteggio e sceglie di difendere la porta posta sotto la curva dei propri sostenitori, sarà quindi <font color=''#FF0000''><b>porchetts</b></font><font color=''#FFFFFF''> a battere il calcio d''inizio.'),
